import React from 'react'

import Quote from '../Quote/Quote'
import Title from '../Title/Title'



function DashboardPage() {
  return (
    <div>
    <Title>Citations</Title>
    <Quote message="Never trust a computer you can't throw out a window." author="Steve Wozniak"></Quote>
    <Quote message="Et c'est parfois dans un regard, dans un sourire Que sont cachés les mots qu'on n'a jamais su dire." author="Yves Duteil"></Quote>
    <Quote message="Les jaloux détruisent ce qu'ils sont incapables de créer." author="Paul Guth"></Quote>
    </div>
  )
}

export default DashboardPage;
